import React, {useEffect, useRef, useState} from 'react'
import Next from '../Components/NextButton/Next'
import ButtonImage from './../Assets/next.png'
import { gsap } from 'gsap'
import './Pages.scss'

/**
* @author
* @function LandingPage
**/

const LandingPage = (props) => {
const days = []
const year = []
const month = ['Jan', 'Feb', 'Mar', 'Apr', 'May', 'Jun', 'Jul', 'Aug', 'Sep','Oct', 'Nov', 'Dec']
const province =''
const year_start = 1900
const year_end = 2021
const month_start = 0
const month_end = 31
const newRef = useRef(null)
var title = 'title'
var data=[];
const [annualPicker, setAnnualPicker] = useState({
  title: '', 
  data: []
})
const [toggle, setToggle] = useState(true)
const [settingDay, setSettingDay] = useState()


    const annual_picker = (start, end, location) => { 
      if(start == end){ 
        return 
      }
      start = start + 1 
      if(location == 'y'){ 
        year.push(start)
      }
      if(location == 'd'){ 
        days.push(start)
      }

      annual_picker(start, end, location)
    }
    annual_picker(year_start, year_end, 'y')
    annual_picker(month_start, month_end, 'd')


    const select_sidebar_list = (settitle, value) => { 
      if(settitle == 'day'){ 
        setSettingDay(value)
      }

      // setSettingMonth()

    }

    const set_sidebar_dates = (title_, data_) => { 
      if(toggle){ 
        gsap.to('.sidebar', {x: '0px', duration: .3})
        setAnnualPicker({
          title: title_, 
          data: data_
        })

        setToggle(!toggle)
      }
      if(!toggle){ 
        gsap.to('.sidebar', {x: '70px', duration: .3})
        setToggle(!toggle)
      }
    }



  return (
    <div className='home_bg'>
      <div id='next_btn_holder'>
        <Next image={ButtonImage} class='orange-btn' link='/educational-video' />
      </div>
      <div id='landing_wrapping'>
       <h1 style={{color: 'white'}}>PLEASE VERIFY YOUR AGE </h1>
       <div id='dob_capture'> 
       <div className='select_container marg_10'> 
       <div className='box'>
        <select ref={newRef} value={settingDay}  id='test_click'> 
          {
            days.map((value, index) =>{
              return(
                <option className='opitons' key={index}>
                    {value}
                </option>
                )
            })
          }
        </select>
        </div>
        <div className='bb-container '>
        <div className='blackBox' onClick={()=>{set_sidebar_dates('day', days)}}></div>
        </div>
        </div>

        <div className='select_container'> 
        <select> 
          {
            month.map((value, index) =>{
              return(
                <option className='opitons' key={index}>
                    {value}
                </option>
                )
            })
          }
        </select>
        <div className='bb-container'>
        <div className='blackBox' onClick={()=>{set_sidebar_dates('month', month)}}></div>
        </div>
        </div>

        <div className='select_container '> 
        <select> 
          {
            year.map((value, index) =>{
              return(
                <option className='opitons' key={index}>
                    {value}
                </option>
                )
            })
          }
        </select>
        <div className='bb-container'>
        <div className='blackBox' onClick={()=>{set_sidebar_dates('year', year)}}></div>
        </div>

        </div>

       </div>
      </div>


      {/* Side bar */}
      <div className='sidebar'>
        <div className='title'>
        <h4 style={{color:'white'}}>{annualPicker.title.toUpperCase()}</h4>
        </div>

        <ul> 
        {
            annualPicker.data.map((value, index) =>{
              return(
                <li className='opitons_list' name={annualPicker.title} key={index} onClick={()=>{select_sidebar_list(annualPicker.title, value)}}>
                    {value}
                </li>
                )
            })
          }
        </ul>

      </div>
    </div>




  )

}

export default LandingPage
